import styles from './NavButton.module.css'

const NavButton = (props) => {
    return (
        <button className={`p-3 ${styles.button}`}>
            {props.icon}
            <p className="text text_type_main-default text_color_inactive">{props.text}</p>
        </button>
    );
};

export default NavButton;
